import React, { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { getDataTable } from '../store/actions';
import { addData, filterData, deleteData } from '../features/reducer/reducer'; // Asegúrate de tener la acción deleteData

const DataTable = () => {
  const dispatch = useDispatch();
  const data = useSelector((state) => state.filteredData); // Datos filtrados de Redux
  const [inputValue, setInputValue] = useState(''); // Estado para el filtro
  const [newData, setNewData] = useState({ nombre: '', descripcion: '' }); // Estado para nuevos datos

  // Obtener los datos del backend cuando el componente se monta
  useEffect(() => {
    dispatch(getDataTable());
  }, [dispatch]);

  // Manejar el filtro de datos (se activará al hacer clic en el botón "Buscar")
  const handleSearch = () => {
    dispatch(filterData(inputValue)); // Despachar la acción de filtro a Redux
  };

  // Manejar la adición de nuevos datos
  const handleAddData = () => {
    const { nombre, descripcion } = newData;
    if (nombre && descripcion) {
      dispatch(addData(newData)); // Despachar la acción para agregar datos
      setNewData({ nombre: '', descripcion: '' }); // Limpiar los inputs después de agregar
    }
  };

  // Manejar la eliminación de un dato
  const handleDelete = (id) => {
    dispatch(deleteData(id)); // Despachar la acción para eliminar el dato por su id
  };

  return (
    <div className="container d-flex justify-content-center align-items-center" style={{ height: '100vh' }}>
      <div className="row w-100">
        <div className="col text-start mb-3">
          {/* Input para filtrar por nombre */}
          <input
            type="text"
            className="col-12"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            placeholder="Filtro de Nombre"
          />
        </div>
        <div className="col text-end mb-3">
          <button type="button" className="btn btn-primary px-3" onClick={handleSearch}>
            Buscar
          </button>
        </div>

        {/* Tabla de datos */}
        <table className="w-100 border">
          <thead>
            <tr>
              <th className="ps-2 border-end header-tabla">Nombre</th>
              <th className="ps-2 border-end header-tabla">Descripción</th>
              <th className="ps-2 header-tabla">Acción</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={item.id}>
                <td className={index % 2 === 0 ? 'ps-2 border-end bg-even' : 'ps-2 border-end'}>{item.nombre}</td>
                <td className={index % 2 === 0 ? 'ps-2 border-end bg-even' : 'ps-2 border-end'}>{item.descripcion}</td>
                <td className={index % 2 === 0 ? 'ps-2 border-end bg-even' : 'ps-2 border-end'}>
                  <button
                    className="link"
                    onClick={() => handleDelete(item.id)} // Al hacer clic en "Eliminar", se elimina el item
                  >
                    Eliminar
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Formulario para agregar nuevos datos */}
        <div className="w-100 bg-crear mt-5 py-4">
          <div className="row">
            <div className="col my-auto">
              <input
                type="text"
                className="col-12"
                value={newData.nombre}
                onChange={(e) => setNewData({ ...newData, nombre: e.target.value })}
                placeholder="Nombre"
              />
            </div>
            <div className="col my-auto">
              <input
                type="text"
                className="col-12"
                value={newData.descripcion}
                onChange={(e) => setNewData({ ...newData, descripcion: e.target.value })}
                placeholder="Descripción"
              />
            </div>
            <div className="col my-auto text-end">
              <button type="button" className="btn btn-success px-4" onClick={handleAddData}>
                Crear
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DataTable;
